-- Create table 自定义与角色关系
create table ORG_ROLE_VS_SERVICE
(
   id                   varchar(64) not null comment '主键',
   service_id           varchar(64) not null comment '组织机构自定义服务Id',
   role_id              varchar(64) not null comment '组织机构角色Id',
   menu_id              varchar(64) comment '菜单Id',
   menu_operator        char(1) comment '菜单操作',
   del_flag             char(1) comment '标志',
   create_by            varchar(64) comment '创建人',
   create_date          datetime comment '创建时间',
   update_by            varchar(64) comment '更新人',
   update_date          datetime comment '更新时间',
   remarks              varchar(500) comment '备注信息',
   primary key (id)
);

alter table ORG_ROLE_VS_SERVICE comment '组织机构角色与拥有服务对照-ORG_ROLE_VS_SERVICE';

alter table ORG_ROLE_VS_SERVICE add constraint FK_Reference_12 foreign key (service_id)
      references ORG_SELF_SERVICE (id) on delete restrict on update restrict;

alter table ORG_ROLE_VS_SERVICE add constraint FK_Reference_13 foreign key (role_id)
      references ORG_ROLE (id) on delete restrict on update restrict;

alter table ORG_ROLE_VS_SERVICE add constraint FK_Reference_14 foreign key (menu_id)
      references sys_menu_dict (id) on delete restrict on update restrict;
